アシックス、サッカースパイク。<br>
前足部は広く、中足部からかかと部にかけてしっかりホールドするワイド設計。異硬度中底の採用により、前足部の屈曲性と中足部からかかと部にかけての剛性を両立。3D SpEVA中敷が優れたフィット性とグラウンドからの突き上げを緩衝。<br><br>
アッパー：人工皮革<br>
アウトソール：合成底(ナイロン)、スタッド/金属製(スチール)、合成樹脂(ナイロン)<br>
インソール：取替可<br>
足幅：ワイド<br>
対応グラウンド：天然芝グラウンド、ぬかるんだ土グラウンド<br>
