<div class="div_tilele_1">商品詳細</div>

2013年3月NEWモデル!!<br>
様々なトップ選手のドリブルを分析し、「素早い動き」と「ボールの扱い易さ」を両立。ドリブルで求められる機能を追求したドリブルとスピードがコンセプトの「ソニック」シリーズの、アッパーがリニューアルされた取替式モデル。幅がワイドなので足入れ感が良く、日本人の足の形にフィットしズレを抑制。<br><br>
